        {
            var response = await Http.PutAsJsonAsync($"api/Boards/{Board.Id}", Board);
            response.EnsureSuccessStatusCode();
            Navigation.NavigateTo("/");
        }
        catch (Exception ex)
        {
            Console.WriteLine(ex.Message);
        }
    }

